import React from "react";
// import { NavLink,Link } from "react-router-dom";
// import { Nav} from "react-bootstrap";
import Headers from '../Header/header';
import Profils from "../Profils/profils";
import Services from "../Services/services";
import './navbar.css'
// import './scripts.js';


export default class Navbar extends React.Component{
    render(){
        return(
        <div id='page-top' >
           <nav className="navbar navbar-expand-lg navbar-dark fixed-top" id="mainNav">
            <div className="container">
                <a className="navbar-brand bord" href="#page-top"><img src="logo_sansfond.png" alt="..." /></a>
                <button classN="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
                    Menu
                    <i classN="fas fa-bars ms-1"></i>
                </button>
                <div classN="collapse navbar-collapse" id="navbarResponsive">
                    <ul classN="navbar-nav text-uppercase ms-auto py-4 py-lg-0">
                        <li classN="nav-item"><a classN="nav-link" href="#page-top">Home</a></li>
                        <li classN="nav-item"><a classN="nav-link" href="#services">Services</a></li>
                        <li classN="nav-item"><a classN="nav-link" href="#portfolio">Profils</a></li>
                        <li classN="nav-item"><a classN="nav-link" href="#about">Ã€ propos</a></li>
                        <li classN="nav-item"><a classN="nav-link" href="#team">Equipes</a></li>
                        <li classN="nav-item"><a classN="nav-link" href="#contact">Contact</a></li>
                    </ul>
                </div>
            </div>
        </nav>
             <Headers />
             <Services />
             <Profils />
        </div> 
            
        )
    }
}
